import React from "react";

const FloatingCat = () => {
  return (
    <section id="floating-cat">
      <div className="cat-container">
        <img
          src={process.env.PUBLIC_URL + "/img/cat.jpg"}
          alt="Jumping Cat"
          className="jumping-cat"
        />
      </div>
    </section>
  );
};

export default FloatingCat;
